import Home from './Home';
import CreateWorkout from './CreateWorkout';
import AddExcerises from './AddExcerises';
import {BrowserRouter as Router,Route,Routes,Navigate} from 'react-router-dom';
import ExcersiseDetails from './ExcersiseDetails';
import Navbar from './Navbar';
import { useState } from 'react';
import { useAuthContext } from "./hooks/useAuthContext";
import Login from './Login';
import Signup from './Signup';


function App() {
  const [formData, setFormData] = useState({ type :'Push', num: 1, date: '7/30/2024'});
  const {user} = useAuthContext()

  return (
    <Router>
    <div className="App">
        <Navbar></Navbar>
        <Routes>
          <Route 
            path = '/'
            element = {user ? <Home/> : <Navigate to="/login"/>}>
          </Route>

          <Route 
            path = '/create' 
            element = {user ?  <CreateWorkout formData={formData} setFormData={setFormData}/> : <Navigate to="/login"/>}>
          </Route>

          <Route 
            path = "/workouts/:id"  
            element={user ? <ExcersiseDetails/> : <Navigate to="/login"/>}>
          </Route>

          <Route 
            path = "/addExcerises" 
            element= {user ? <AddExcerises formData={formData} /> : <Navigate to="/login"/>}>
          </Route>

          <Route 
              path = '/login' 
              element = { !user ? <Login/> : <Navigate to="/"/>}>
          </Route>

          <Route 
              path = '/signup' 
              element = { !user ? <Signup/> : <Navigate to="/"/> }>
          </Route>

        </Routes>

      </div>
      </Router>


  );
}

export default App;
